import NavBar from '../home/NavBar';
import Footer from '../home/Footer';
import Form from '../home/Form';
import DetailPage from './DetailPage';

const Detail = () => {
  return (
    <div>
      <NavBar />
      <DetailPage />
      <Form />
      <Footer />
    </div>
  );
};

export default Detail;
